    "2013-03-15T22:53:04.634456",nt"name": "south-dakota-borehole-temperatures",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains borehole temperature
    observations compiled by the South Dakota Geological Survey, and published as a
    Web feature service for the National Geothermal Data System. Fields in the Borehole
    Temperature Observation Content Model will become XML elements in interchange documents
    for WMS simple features provided by a node in the USGIN network. Each feature includes
    a well name, temperature measurement as well as Latitude and Longitude spatially
    referenced to EPSG: 4326 (for interoperability). The data contained in the submitted
    dataset is available as an Excel Spreadsheet, ESRI service, WMS and WFS service.
    Link to Borehole Temperature Observation Content Model: http://stategeothermaldata.org/data_delivery/content_models/borehole_temperature_observation.
